import React, { useState } from "react";
import "./index.css";
 

const App=()=>{
const state=useState();

const gettime=()=>{
  let curtime=new Date().toLocaleTimeString();

}
<gettime />
const[time,settime]=useState(curtime);


const IncTime=()=>{
  <gettime />
settime(curtime);
}

return(
  <>
    <h1>{time}</h1>
    <button onClick={IncTime}>Click Me</button>
  </>
);

}
export default App;
